import React from "react";

// Define a Card component
const Card = ({ name, email, phone, avatar }) => (
  <div
    className="card"
    style={{
      width: "250px",
      height: "250px",
      borderRadius: "30px",
      boxShadow: "0px 0px 10px rgba(0, 0, 0, 0.1)",
      overflow: "hidden",
      marginBottom: "5%",
      backgroundColor: "gray",
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      justifyContent: "center",
      padding: "10px",
    }}
  >
    <img
      src={avatar}
      alt={`${name}'s avatar`}
      className="avatar"
      style={{
        width: "35%",
        height: "35%",
        objectFit: "cover",
        borderRadius: "100%",
      }}
    />
    <div className="card-details" style={{ padding: "15px", color: "white" }}>
      <h2>{name}</h2>
    </div>
  </div>
);

